That's actually not that bad. A lot of people do not play the games they buy, for various reasons. That's why publishers invest in marketing that much. We see a hype train, we jump in, we always hope to play next weekend, we never actually have time. Kinda stupid, but it's normal. Here some other examples:
Hades: 17% didn't clear Tartarus, 51% didn't clear a single escape;
Hollow Knight: 30% didn't clear the very first boss;
Ori and the Blind Forest: 20% didn't finish Prologue;
GTA V: 17% didn't finish the first mission;
Subnautica: 12% didn't get in the water, 46% didn't build a Seamoth;
Witcher 3: 38% didn't find Yennifer;
Fallout 4: 17% never made it out of the tutorial Vault, 33% didn't reach level 5;
Borderlands 2: 18% didn't reach level 5, 34% didn't reach level 10;
Half-life 2: 33% didn't find the crowbar.

Now, one might say: "Well, don't buy the bloody game if you ain't sure you'll have time to play it". That's not how humans work tho. You want to believe you'll have time and you want the game to be ready for the occasion. XD

